import React from 'react'

const GridGallery = ({list}) => {
    return (
        <div className={styles.container}>
            {list.map((item, index) =>(
                <div key={index} className={styles.item}>
                    {item}
                </div>
            ))}
        </div>
    )
}

export default GridGallery
